/** Construct a plane through two points and origin.
 *@param A is the first point (origin based).
 *@param B is the second point (origin based).
 */
public Plane(Vector A, Vector B) {
    super(A,B);
    D = 0.0;
}

/** Construct a plane through two points and origin.
 *@param A is the first point (origin based).
 *@param B is the second point (origin based).
 */
public Plane(final Vector A, final Vector B) {
    super(A,B);
    D = 0.0;
}

